import React, { useEffect, useState } from 'react'

import './style.css'

const Home = () => {
    const [getData, setGetData] = useState([])
    const url = 'http://hp-api.herokuapp.com/api/characters'

    useEffect(() => {
        fetch(url)
        .then(resp => resp.json())
        .then(data => {
            //console.log(data)
            setGetData(data)
        })

    },[])

    const card = getData.map((infos, index) => {
        return(
            <div in>
                {infos.name}
            </div>
        )
    })



    return(
        <div>
            {card}
        </div>
    )
}

export default Home
